const fetchAthlete = async ({queryKey}) => {
    const id = queryKey[1];

    const apiRes = await fetch(`http://localhost:3030/athletes`)

    if(!apiRes.ok) {
        throw new Error(`athletes/${id} fetch not ok`);
    }

    return apiRes.json()
}

export default fetchAthlete;
